import React, { Component } from 'react'

export default class Counter extends Component {
  render() {
    return <div className='bg-white rounded-md m-10 '>
        <h1 className='place-self-center text-6xl p-4 font-semibold'>Count: 0</h1>

        <div>
            <button className='hover:bg-green-800 hover:text-white hover:drop-shadow-2xl border-2 border-green-800 text-green-800 px-4 py-2 mx-2 my-4 rounded-xl'>Increament</button>
            <button className='hover:bg-red-800 hover:text-white hover:drop-shadow-2xl border-2 border-red-800 text-red-800 px-4 py-2 mx-2 my-4 rounded-xl'>Decreament</button>
        </div>

    </div>;
  }
}
